import "./Header.css";
import logo from "../../assets/logo.jpeg";
import { Button } from "@material-ui/core";

const Header = () => {
  return (
    <div>
      <img src={logo} alt="logo loading..." />
      <button></button>
    </div>
  );
};

export default Header;
